import React, {useState} from 'react';
import './App.css';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Login from './Login';
import SideNav from './SideNav';

function App() {
  return (
    <BrowserRouter basename={process.env.REACT_APP_BASE_URL}>
      <div className="App">
        <SideNav />
      </div>
    </BrowserRouter>
  );
}

export default App;
